import React, { useState } from 'react';
import { v4 as uuidv4 } from 'uuid';

import FormInput from '../component/FormInput';

import { insertTicketInfo } from '../ApiCaller';
import { workshopOption, dietaryOption, occupationOption, heardOption, attendOption } from '../Data';

const GetTicket = () => {
  const [ShowForm, setShowForm] = useState(true);
  const [ShowSuccess, setShowSuccess] = useState(false);

  const initialValues = { 
    FirstName: "",
    LastName: "",
    ChnName:"",
    PhoneNumber: "",
    Email: "",
    School: "",
    Age: ""
  };

  const [formValues, setFormValues] = useState(initialValues);

  const ID = uuidv4().replace(/-/g, '');

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = new FormData(e.target);
    try {
      insertTicketInfo(Object.fromEntries(data.entries()), ID);
      setShowForm(false);
      setShowSuccess(true);
    } catch (error) {
      console.error(error);
      alert("There's something wrong with our server. Please check back later.");
    }
  }

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value});
    console.log(formValues);
  }

  return (
    <div>
      {ShowForm &&(<div className='TicketPage'>
        <pre>{ JSON.stringify(formValues) }</pre>
        <form onSubmit={handleSubmit} className="FormSection">
          <h1 className='FormTitle'>Register(Testing)</h1>
          <FormInput name="FirstName" type="input" value={formValues.FirstName} onChange={handleChange} placeholder="First Name" question="First Name" errorMessage="First name cannot exceed 20 characters and shouldn't contain any special character." />
          <FormInput name="LastName" type="input" value={formValues.LastName} onChange={handleChange} placeholder="Last Name" question="Last Name" errorMessage="Last name cannot exceed 20 characters." />
          <FormInput name="ChnName" type="input" value={formValues.ChnName} onChange={handleChange} placeholder="Chinese Name" question="Chinese Name" errorMessage="Chinese name cannot exceed 20 characters." />
          <FormInput name="PhoneNumber" type="input" value={formValues.PhoneNumber} onChange={handleChange} placeholder="Phone Number" question="Phone Number" />
          <FormInput name="Email" type="input" value={formValues.Email} onChange={handleChange} placeholder="Email" question="Email" />
          <FormInput name="School" type="input" value={formValues.School} onChange={handleChange} placeholder="School" question="School" />
          <FormInput name="Age" type="input" value={formValues.Age} onChange={handleChange} placeholder="Age" question="Age" />
          <FormInput name="Taiwanese" type="menu" options={["Select", "Yes", "No"]} question="Are you a Taiwanese?" />
          <FormInput name="Workshop" type="menu" options={workshopOption} question="What is the workshop you want to attend?" />
          <FormInput name="Dietary" type="menu" options={dietaryOption} question="Do you have any dietary restrictions?" />
          <FormInput name="Occupation" type="menu" options={occupationOption} question="What is your current occupation?" />
          <FormInput name="Attended" type="menu" options={attendOption} question="Did you attend the event in 2022?" />
          <FormInput name="Heard" type="menu" options={heardOption} question="How did you hear about this event?" />
          <button className='TicketSubmit'>Submit</button>
        </form>
      </div>)}
      {ShowSuccess &&(
        <div className='RedeemPage'>
          <div className='RedeemSection'>
            <h1 className='RedeemH1'>Last step...</h1>
            <p className='EtransferP'>To pay your ticket, please E-transfer $15 to example@gmail.com with your name as comment. Once we confirmed the transaction, we'll proceed your application and send you confirmation Email.</p>
            <button onClick={() => {
              navigator.clipboard.writeText("example@gmail.com");
              alert("Copied!");
            }} className="RedeemBt">Copy Email</button>
          </div>
        </div>)}
    </div>
  )
}

export default GetTicket
